import React, { useState } from "react";
import { Link } from 'react-router-dom';

import './help.css';

function Help() {

    return (
        <div className="help">
            <div className="nav">
                <Link to='/'><span>Home</span></Link>
                <Link to='/findQuestion'><span>find question</span></Link>
                <Link to='/help'><span>help</span></Link>
            </div>

        </div>
    )
}

export default Help
